set -e

cd release_contract
dfx stop
dfx start --background --clean
DFX_HOME=/root

echo "==============CREATE MINNER IDENTITY================"
REVERSE_MINER="reverse_miner"
REVERSE_MINER_HOME_DIR="$DFX_HOME/.config/dfx/identity/$REVERSE_MINER"

if [ -d "$REVERSE_MINER_HOME_DIR" ]; then
    echo "Found $REVERSE_MINER identity in $REVERSE_MINER_HOME_DIR" 
else
    echo "No identity directory found, I'm going to create a new $REVERSE_MINER identity and persist it"
    dfx identity new "$REVERSE_MINER" --storage-mode=plaintext
fi
dfx identity use "$REVERSE_MINER"
REVERSE_MINER_PRINCIPAL=$(dfx identity get-principal)
echo "======REVERSE_MINER_PRINCIPAL=\"$REVERSE_MINER_PRINCIPAL\" ================"

echo "==============CREATE GOV IDENTITY================"
REVERSE_GOV="reverse_gov"
REVERSE_GOV_HOME_DIR="$DFX_HOME/.config/dfx/identity/$REVERSE_GOV"

if [ -d "$REVERSE_GOV_HOME_DIR" ]; then
    echo "Found $REVERSE_GOV identity in $REVERSE_GOV_HOME_DIR" 
else
    echo "No identity directory found, I'm going to create a new $REVERSE_GOV identity and persist it"
    dfx identity new "$REVERSE_GOV" --storage-mode=plaintext
fi

echo "==============CREATE MAIN SITE IDENTITY================"
REVERSE_MAIN_SITE="reverse_main_site"
REVERSE_MAIN_SITE_HOME_DIR="$DFX_HOME/.config/dfx/identity/$REVERSE_MAIN_SITE"

if [ -d "$REVERSE_MAIN_SITE_HOME_DIR" ]; then
    echo "Found $REVERSE_MAIN_SITE identity in $REVERSE_MAIN_SITE_HOME_DIR" 
else
    echo "No identity directory found, I'm going to create a new $REVERSE_MAIN_SITE identity and persist it"
    dfx identity new "$REVERSE_MAIN_SITE" --storage-mode=plaintext
fi
dfx identity use "$REVERSE_MAIN_SITE"
REVERSE_MAIN_SITE_PRINCIPAL=$(dfx identity get-principal)

dfx identity use "$REVERSE_GOV"
REVERSE_GOV_PRINCIPAL=$(dfx identity get-principal)
echo "======REVERSE_MINER_PRINCIPAL=\"$REVERSE_MINER_PRINCIPAL\" ================"

echo "===========Prepared Reverse Tokens===================="
dfx deploy reverse_ledger_canister --argument "(variant {
  Init = record {
    token_symbol = \"REV\";
    token_name = \"Reverse\";
    minting_account = record {
      owner = principal \"$REVERSE_MINER_PRINCIPAL\"
    };
    transfer_fee = 10;
    metadata = vec {
       record {
            \"icrc1:logo\";
             variant {
                  Text = \"data:image/jpeg;base64,\"
             };
       };
    };
    initial_balances = vec {
      record {
        record {
          owner = principal \"$REVERSE_GOV_PRINCIPAL\";
        };
        20_000_000_000_000_000;
      };
    };
    archive_options = record {
      num_blocks_to_archive = 1000;
      trigger_threshold = 2000;
      controller_id = principal \"$REVERSE_GOV_PRINCIPAL\";
    };
    feature_flags = opt record {
      icrc2 = true;
    };
  }
})"

export REVERSE_TOKEN_CANISTER_ID=$(dfx canister id reverse_ledger_canister)

dfx deploy reverse_index_canister --argument "(opt variant { Init = record { ledger_id = principal \"$REVERSE_TOKEN_CANISTER_ID\"} })"

echo "===========balance of GOV_ACCOUNT========="
dfx canister call reverse_ledger_canister icrc1_balance_of "(record {
  owner = principal \"$REVERSE_GOV_PRINCIPAL\";
})"

echo "===========SETUP DONE========="

echo "===========icrc2_approve========="
dfx canister call  reverse_ledger_canister icrc2_approve "(
  record {
    spender= record {
      owner = principal \"$REVERSE_MAIN_SITE_PRINCIPAL\";
    };
    amount = 20_000_000_000_000_000: nat;
  }
)"


dfx canister call  reverse_ledger_canister icrc2_approve "(
  record {
    spender= record {
      owner = principal \"$REVERSE_MAIN_SITE_PRINCIPAL\";
    };
    amount = 2_000_000_000_000_000: nat;
  }
)"

echo "===========Related principal========="
echo "REVERSE_MAIN_SITE_PRINCIPAL: $REVERSE_MAIN_SITE_PRINCIPAL"
echo "REVERSE_GOV_PRINCIPAL: $REVERSE_GOV_PRINCIPAL"
echo "REVERSE_MINER_PRINCIPAL: $REVERSE_MINER_PRINCIPAL"
